def _convert_key(self, key, is_setter: bool = False):
    """
    Require the keys to be the same type as the index. (so we don't
    fallback)
    """
    # allow arbitrary setting
    if is_setter:
        return list(key)

    for ax, i in zip(self.obj.axes, key):
        index_type = type(ax)
        key_type = type(i)
        if index_type == pd.DatetimeIndex:
            if key_type != pd.Timestamp:
                raise ValueError(
                    "Datetime based indexing on a datetime index "
                    "can only have datetime indexers"
                )
        elif index_type == pd.TimedeltaIndex:
            if key_type != pd.Timedelta:
                raise ValueError(
                    "Timedelta based indexing on a timedelta index "
                    "can only have timedelta indexers"
                )
        elif index_type == pd.Float64Index:
            if key_type != float:
                raise ValueError(
                    "Float based indexing on a float index "
                    "can only have float indexers"
                )
        else:
            raise ValueError("Unsupported index type")
    return key
